import "../App.css";
//import Article from "./Article";
const fart = async () => {
  try {
    const array = [];
    const url = "http://localhost:5000/articles";
    array.push(await (await fetch(url)).json());
    return array;
  } catch (err) {
    console.error(err);
  }
};

const Articles = async ({ fart }) => {
  return <h1>{fart.array}</h1>;
};

export default Articles;
